import axios from "axios";

export function getUserDetails(){
    return axios.get("http://localhost:5000/api/user", {
        withCredentials: true
    });
}

export function getCharacters(){
    return axios.get("http://localhost:5000/api/character", {
        withCredentials: true
    });
}
